group.description:
Schriftzeichen, die wegen der Abwärtskompatibilität zum Standard „Lateinische Zeichen in Unicode Version 1.1“ (auch „String.Latin 1.1“ genannt) zwingend erforderlich sind;
        Für die Darstellung von Namen natürlicher Personen sowie sonstiger Namen, wie z. B. Ortsnamen und Straßennamen, sind diese Zeichen ungeeignet und sollten deshalb bei allen für diese
        Namen bestimmten Datenfeldern nicht zum Einsatz kommen. Diese Zeichen sind jedoch relevant für Namen juristischer Personen und für Produktnamen
